description:
You can animate!

Do animation sketches and poses of manikin on your tablet or smartphone at any free minute.

Now you have the handy tool for this.

Simplified figure of man has the necessary minimum for quick posing.
For convenience simplified controls also: by finger touch on free area you twist camera, by touch and drag you move body or its parts. Standart zoom and translate view by two fingers.

App is useful for professional animators and students, game developers, storyboard artists and for all fans of animation.
Play sports or dance? This app is also for you! With it, you'll better explore and understand the right movement.
You can show to your children how to make cartoons. And they can make their own.

Save animations and share with friends.

Features:
- Creation, editing and opening scenes, containing information about character, the list of clips (up to 4 on each scene) and used land (buildings);
- Animation clips creating and editing  (up to 32 key frames in each clip, up to 20 files);
- Each animation clip can be played on the spot or edited path. For each clip is set up number of cycles and the amount automaticly added inbetween frames for smoothness and speed of playback;
- Poses copy, paste, mirroring and reset;
- "Ghost" of the previous and next frame enable;
- Character selection;
- Skins selection for any characters;
- Adding user skins (up to 10 png images);
- Props selection;
- Lands (buildings) creation and editing of the cubes.

